node.text:
Voce Libera è stato fondato nel 2013 a Busto Arstizio da Fabrizio Corona e la sua agenzia.

È stato il giornale più innovativo dei detenuti italiani, nato da un’idea di Fabrizio Corona il progetto è stato portato avanti per 3 anni dal direttore, giornalista Federico Corona.

I detenuti avevano la possibilità di pubblicare le proprie idee ed i propri articoli sul portale online del Fatto Quotidiano.

Oggi la Carfagna ci ha copiato il nome creando un partito che non ha niente a che vedere con i diritti dei detenuti Italiani.

